Noto- and neurosetae including long serrated capillaries on all segments, with 3–5 capillaries in notopodia and 2–4 capillaries in neuropodia. Long capillaries prominent along entire body (
Fig. 50A
). Noto- and neuropodia also with 1–2 short curved acicular spines, directed towards one another, vis-à-vis (
Fig. 49C
).

Pygidium simple, rounded, bi-lobed, surrounding anal opening; anal cirri absent (
